import { Route, Router, Routes } from 'react-router';
import './App.css';
import Login from './components/Auth/login/login';
import Signup from './components/Auth/signup/signup';
import CustomerDashboard from './components/Customer/dashboard';
import BookDetails from './components/book/desc';
import AuthorDetails from './components/book/author';


function App() {
  return (

    <div className="App">
      {/* <BookDetails /> */}
      {/* <AuthorDetails /> */}
    <Routes>

    <Route path="/" element={<CustomerDashboard/>}></Route>
    <Route path="/books/:bid" element={<AuthorDetails />} />

    <Route path="/customer/dashboard" element={<CustomerDashboard/>}></Route>
    <Route path='/books/:id' element={<BookDetails />} />
    <Route path='/authors/:id' element={<BookDetails />} />
    <Route path='/auth/login'element={<Login/>}></Route>
    <Route path='/author/desc' element={<AuthorDetails />} />
    <Route path='/auth/signup'element={<Signup/>}></Route>


    </Routes>

   </div>

  );
}

export default App;
